import CardArray from './CardArray'
import SearchBox from './SearchBox'
import { robots } from './Robots'

class App extends Component {
    constructor(){
        super()
        this.state = {
            robots : robots,
            searchfield: ''
        }
    }
     onSearchChange = (event) =>{
         this.setState({ searchfield:event.target.value })
          }

    render() {
        <h1>Hello</h1>
    }
}

export default App;
